import styles from "./AddLunchForm.module.css";
import UserContext from "../userContext";
import TextField from "@material-ui/core/TextField";
import { FormHelperText } from "@material-ui/core";

export default function AddLunchForm() {
  const userContext = useContext(UserContext);

  useEffect(() => {
    fetchProfile();
  }, []);

  function handleSubmit(event) {
    event.preventDefault();

    fetch(
      "http://localhost:4000/accounts/addlunch" +
        `?email=${userContext.user.email}`,
      {
        method: "POST", // *GET, POST, PUT, DELETE, etc.
        mode: "cors",
        cache: "no-cache",
        headers: {
          "Content-Type": "application/json",
          Authorization: userContext.user.token,
        },
        body: JSON.stringify({}),
      }
    )
      .then((response) => {
        console.log(response.status);

        return response.json();
      })
      .then((json) => {
        // setName(json.name);
        // console.log("json", json);
      })
      .catch((err) => console.log("err", err));
  }

  return (
    <div className={styles.Login}>
      <div className={styles.container}>
        <h1 className={styles.title}>Add lunch offert</h1>
        <TextField
          classes={{ root: styles.CustomInput }}
          name="email"
          label="Email"
          variant="outlined"
          onChange={handleChange}
        />
      </div>
    </div>
  );
}
